int		get_action(t_token *token, int state)
{
	int		col = 0;
	int		line;

	while (col < nb_col && token_table[col] != token->id)
		col++;
	if (col == nb_col)
	{
		printf("Eror get action bad token\n");
		return (-1);
	}
	line = state;
	return (action_table[line][col]);
}
